  `finished_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `created_by` int DEFAULT NULL,
  PRIMARY KEY (`meeting_id`),
  KEY `FK2o0gx77k1mxsy15tu2wi6ps70` (`created_by`),
  KEY `FKl06rl0snrknaq0euxbqrnuvc2` (`room_id`),
